import React, { useEffect, useState } from "react";
import {
  ScatterChart,
  Scatter,
  XAxis,
  YAxis,
  CartesianGrid,
  Tooltip,
  Legend,
  ResponsiveContainer,
} from "recharts";

const PersonalResults = ({ userId }) => {
  const [summaryAttempts, setSummaryAttempts] = useState([]);
  const [fullPassageAttempts, setFullPassageAttempts] = useState([]);
  const [globalAverages, setGlobalAverages] = useState({ summary: null, full: null });
  const [loading, setLoading] = useState(false);
  const [error, setError] = useState(null);

  useEffect(() => {
    if (!userId) return;

    async function fetchData() {
      setLoading(true);
      setError(null);

      try {
        const res = await fetch(
          `https://read-racer.azurewebsites.net/api/getUserResults?userId=${encodeURIComponent(userId)}`
        );
        if (!res.ok) throw new Error(`HTTP error! status: ${res.status}`);
        const data = await res.json();
        console.log("Fetched user results API raw:", data);

        const results = Array.isArray(data) ? data : data.results || [];
        const summary = results.filter((r) =>
          r.useSummary === true || r.useSummary === "true" || r.useSummary === "True"
        );
        const full = results.filter((r) =>
          !(r.useSummary === true || r.useSummary === "true" || r.useSummary === "True")
        );

        setSummaryAttempts(summary);
        setFullPassageAttempts(full);

        setGlobalAverages({
          summary: data.summaryAvg || null,
          full: data.passageAvg || null,
        });
      } catch (err) {
        console.error("Failed to load user results:", err);
        setError(err.message || "Failed to load user results");
      } finally {
        setLoading(false);
      }
    }

    fetchData();
  }, [userId]);

  const renderChart = (data, label, showEffective, globalDot) => {
    if (!data || data.length === 0) return <p>No attempts yet.</p>;

    return (
      <div className="mb-8">
        <h3 className="text-xl font-semibold mb-2 text-gray-700">{label}</h3>
        <ResponsiveContainer width="100%" height={300}>
          <ScatterChart margin={{ top: 10, right: 20, bottom: 20, left: 0 }}>
            <CartesianGrid />
            <XAxis
              type="number"
              dataKey="value"
              name="Reading Speed"
              unit=" WPM"
              domain={["auto", "auto"]}
            />
            <YAxis
              type="number"
              dataKey="accuracy"
              name="Accuracy"
              unit="%"
              domain={[0, 100]}
            />
            <Tooltip cursor={{ strokeDasharray: "3 3" }} />
            <Legend />

            <Scatter
              name={showEffective ? "Real WPM" : "Reading Speed"}
              data={data.map((d) => ({ ...d, value: d.realWPM }))}
              fill="#3b82f6"
            />

            {showEffective && (
              <Scatter
                name="Effective WPM"
                data={data.map((d) => ({ ...d, value: d.effectiveWPM }))}
                fill="#10b981"
              />
            )}

            {globalDot && (
              <>
                <Scatter
                  name={showEffective ? "Global Avg Real WPM" : "Global Avg Reading Speed"}
                  data={[{ value: globalDot.realWPM, accuracy: globalDot.accuracy }]}
                  fill="#ef4444"
                  shape="star"
                />
                {showEffective && (
                  <Scatter
                    name="Global Avg Effective WPM"
                    data={[{ value: globalDot.effectiveWPM, accuracy: globalDot.accuracy }]}
                    fill="#fbbf24"
                    shape="star"
                  />
                )}
              </>
            )}
          </ScatterChart>
        </ResponsiveContainer>
      </div>
    );
  };

  if (!userId) return <p>Please log in to see your personal results.</p>;
  if (loading) return <p>Loading your results...</p>;
  if (error) return <p className="text-red-600 font-semibold">Error: {error}</p>;

  return (
    <div className="p-6 max-w-4xl mx-auto">
      <h2 className="text-3xl font-bold mb-6 text-gray-800">Your Personal Results</h2>

      {renderChart(
        summaryAttempts.map((r) => ({
          realWPM: r.realWPM || 0,
          effectiveWPM: r.effectiveWPM || 0,
          accuracy: r.total > 0 ? Math.round((r.score / r.total) * 100) : 0,
        })),
        "AI Summary Attempts",
        true,
        globalAverages.summary && {
          realWPM:
            globalAverages.summary.realWPM ??
            globalAverages.summary.readingSpeed ??
            0,
          effectiveWPM:
            globalAverages.summary.effectiveWPM ??
            globalAverages.summary.readingSpeed ??
            0,
          accuracy: Math.round(globalAverages.summary.accuracy * 100),
        }
      )}

      {renderChart(
        fullPassageAttempts.map((r) => ({
          realWPM: r.realWPM || 0,
          accuracy: r.total > 0 ? Math.round((r.score / r.total) * 100) : 0,
        })),
        "Full Passage Attempts",
        false,
        globalAverages.full && {
          realWPM:
            globalAverages.full.realWPM ??
            globalAverages.full.readingSpeed ??
            0,
          effectiveWPM:
            globalAverages.full.effectiveWPM ??
            globalAverages.full.readingSpeed ??
            0,
          accuracy: Math.round(globalAverages.full.accuracy * 100),
        }
      )}
    </div>
  );
};

export default PersonalResults;
